import React, { useEffect } from 'react';
import styled from 'styled-components';
import Aos from 'aos';
import 'aos/dist/aos.css';
import Logo from '../components/LandingPage/Logo';
import Announces from '../components/LandingPage/Announces';
import { TEXTLOGO_URL } from '../config';

const LandingPage: React.FC = () => {

    useEffect(() => {
        Aos.init();
    },[]);

    return (
        <Wallpaper>
            <Header><LogoImage/></Header>
            <Logo />
            <Announces/>
            <MobileBottomBar>
                <GooglePlayButton>
                    GooglePlayStore
                </GooglePlayButton>
                <AppStoreButton>
                    AppStore
                </AppStoreButton>
            </MobileBottomBar>
        </Wallpaper>
    );
};

export default LandingPage;

const Wallpaper = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 100%;
    height: 100%;
    overflow-x: hidden;
    background-color: ${({ theme }) => theme.colors.backgroundWhite};
`;

const Header = styled.div`
    display: flex;
    flex-direction: row;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 90px;
    background-color: ${({ theme }) => theme.colors.backgroundWhite};
    z-index: 9999;
`;

const MobileBottomBar = styled.div`
    display: flex;
    flex-direction: row;
    position: fixed;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 70px;
    z-index: 9999;
`;

const GooglePlayButton = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: white;
    width: 100%;
`;

const AppStoreButton = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    background-color: black;
    color: white;
    width: 100%;
`;

const LogoImage = styled.div`
    width: 350px;
    height: 100px;
    background-image: url(${TEXTLOGO_URL});
    background-size: cover;
    margin-top: 30px;
    background-position: center;
    /* @media only screen and (max-width: 500px) {
        width: 450px;
        height: 450px;
    } */
`;
